import React, {Component} from 'react';
import "./Header.css";

export class Header extends Component {
    render() {
        return (
            <div className="headerContainer">
                <div id="header">
                    We provide diagnostic imaging informatics solutions.
                </div>
            </div>
        );
    }
}

export default Header;
